import React from 'react'
import { Link } from 'react-router-dom';
import data from '../data';
import MenuScreen from './MenuScreen';

function HomeScreen (props) {
   return <ul className="menus">
   {
       data.menus.map(MenuScreen =>
           <li>
           <div className="menu">
           <Link to={'/menu/' + menu._id}> {menu.name}
           <img className="menu-image" src={menu.image} alt="menu" />
           </Link>
            <div className="menu-name">
            <Link to={'/menu/' + menu._id}> {menu.name}</Link>
               </div>
               <div className="menu-type">{menu.type}</div>
               <div className="menu-price">Rs{menu.price}</div>
               <div className="menu-rating">{menu.rating} Stars ({menu.numReviews})</div>
           </div>
       </li> )
   }
   
   
</ul>
}
export default HomeScreen;
